import React, { useState } from 'react';
import '../styles/contact.css';

function Contact() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission here
    console.log('Form submitted:', formData);
    alert('Thank you for your message! I\'ll get back to you soon.');
    setFormData({ name: '', email: '', subject: '', message: '' });
  };

  const contactInfo = [
        {
          icon: "üìß",
          label: "Email",
          value: "priyasmpn9865@gmail.com",
          link: "mailto:priyasmpn9865@gmail.com"
        },
        {
          icon: "üì±",
          label: "Phone",
          value: "+91 75025 65557",
          link: "tel:+917502565557"
        },
        {
          icon: "üåê",
          label: "LinkedIn",
          value: "linkedin.com/in/priyadharshini2214",
          link: "https://www.linkedin.com/in/priyadharshini2214"
        },
        {
          icon: "üìç",
          label: "Location",
          value: "Salem, Tamil Nadu, India",
          link: null
        }
      ];

  return (
    <section id="contact" className="contact-section">
      <div className="contact-container">
        <div className="contact-modern-row">
          <div className="contact-modern-left">
            <h2 className="contact-modern-title">Get in Touch</h2>
            <div className="contact-modern-subtitle">I'd like to hear from you!</div>
            <div className="contact-modern-desc">
              If you have any inquiries or just want to say hi, please use the contact form!
            </div>
            <div className="contact-modern-email-row">
              <span className="contact-modern-icon">üìß</span>
              <a href="mailto:priyasmpn9865@gmail.com" className="contact-modern-email">priyasmpn9865@gmail.com</a>
            </div>
            <div className="contact-modern-socials">
              <a href="https://www.instagram.com/" target="_blank" rel="noopener noreferrer" aria-label="Instagram" className="contact-modern-social"><i className="fab fa-instagram"></i></a>
              <a href="https://www.facebook.com/" target="_blank" rel="noopener noreferrer" aria-label="Facebook" className="contact-modern-social"><i className="fab fa-facebook-f"></i></a>
              <a href="https://www.behance.net/" target="_blank" rel="noopener noreferrer" aria-label="Behance" className="contact-modern-social"><i className="fab fa-behance"></i></a>
              <a href="https://www.vimeo.com/" target="_blank" rel="noopener noreferrer" aria-label="Vimeo" className="contact-modern-social"><i className="fab fa-vimeo-v"></i></a>
              <a href="https://www.linkedin.com/in/priyadharshini2214" target="_blank" rel="noopener noreferrer" aria-label="LinkedIn" className="contact-modern-social"><i className="fab fa-linkedin-in"></i></a>
            </div>
          </div>
          <div className="contact-modern-right">
            <form className="contact-modern-form" onSubmit={handleSubmit}>
              <div className="contact-modern-form-row">
                <div className="contact-modern-form-group">
                  <label htmlFor="firstName">First Name</label>
                  <input
                    type="text"
                    id="firstName"
                    name="firstName"
                    value={formData.firstName || ''}
                    onChange={handleChange}
                    autoComplete="off"
                  />
                </div>
                <div className="contact-modern-form-group">
                  <label htmlFor="lastName">Last Name</label>
                  <input
                    type="text"
                    id="lastName"
                    name="lastName"
                    value={formData.lastName || ''}
                    onChange={handleChange}
                    autoComplete="off"
                  />
                </div>
              </div>
              <div className="contact-modern-form-group">
                <label htmlFor="email">Email *</label>
                <input
                  type="email"
                  id="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                  required
                  autoComplete="off"
                />
              </div>
              <div className="contact-modern-form-group">
                <label htmlFor="message">Message</label>
                <textarea
                  id="message"
                  name="message"
                  value={formData.message}
                  onChange={handleChange}
                  rows="4"
                  autoComplete="off"
                ></textarea>
              </div>
              <div className="contact-modern-form-actions">
                <button type="submit" className="contact-modern-send-btn">Send</button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Contact;
